import React from "react";
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import { isAuthenticated } from "./services/auth";

import { Evaluation } from './evaluation'
import { Users } from './users'
import { Company } from './company'
import { Home } from './home'
import Login from "./login";


     // <div>
      //   <nav className="sidenav sidenav-fixed menu-left corPadrao darken-4">
      //     <ul>
      //       <li>
      //         <Link to="/*"><i class="large material-icons white-text">home</i></Link>
      //       </li>
      //       <li>
      //         <Link to="/company"><i class="large material-icons white-text">business</i></Link>
      //       </li>
      //       <li>
      //         <Link to="/users"><i class="large material-icons white-text">people</i></Link>
      //       </li>
      //       <li>
      //           <Link to="/evaluation"><i class="large material-icons white-text">assignment</i></Link>
      //       </li>
      //     </ul>
      //   </nav>

const PrivateRoute = ({ component: Component, ...rest }) => (
  <Route
    {...rest}
    render={props =>
      isAuthenticated() ? (
        <Component {...props} />
      ) : (
        <Redirect to={{ pathname: "/", state: { from: props.location } }} />
      )
    }
  />
);

const Menu = () => (
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={SignIn} />
      <Route exact path="/signup" component={SignUp} />
      <Route exact path="/forgot" component={Forgot} />
      <Route path="/passwords/confirm/:id" component={ForgotVolta} />

      <PrivateRoute exact path="/app" component={App} />
      <PrivateRoute exact path="/home" component={Home} />

      {/* usuarios */}
      <PrivateRoute exact path="/user" component={User} />
      <PrivateRoute exact path="/AddUser" component={AddUser} />
      <PrivateRoute exact path="/user/:id" component={userEdit} />

      {/* pedidos */}
      <PrivateRoute exact path="/orders" component={Order} />

      {/* categorias */}
      <PrivateRoute exact path="/category" component={Category} />
      <PrivateRoute exact path="/AddCategory" component={AddCategory} />
      <PrivateRoute exact path="/category/:id" component={categoryEdit} />


      {/* produtos */}
      <PrivateRoute exact path="/products" component={Product} />
      <PrivateRoute exact path="/AddProduct" component={AddProduct} />
      <PrivateRoute exact path="/products/:id" component={ProductEdit} />

      {/* relatorios */}
      <PrivateRoute exact path="/relatory" component={Relatory} />

      {/* pagina de erro */}
      <Route path="*" component={() => <h1>Page not found</h1>} />
    </Switch>
  </BrowserRouter>
);
